Футбол Англии от Sports.ru для iOS - это вся информация об Английской футбольной Премьер-Лиге сегодня! 

Приложение Футбол Англии включает: 

• Все свежие новости о клубах чемпионата Англии из более чем 700 источников; 
• Освещение всех игр и событий сезона; 
• Полная информация о трансферах; 
• Полная статистика всех матчей чемпионата в режиме реального времени, а также статистика игроков; 
• Текстовые онлайн трансляции всех матчей, календарь чемпионата Англии и турнирная таблица; 
• Интервью, репортажи и мнения экспертов; 
• Галереи с яркими и актуальными фото; 
• Блоги и материалы пользователей об АПЛ; 
• Широкие возможности для общения с другими 
болельщиками команды.

Лига 1. Чемпионат Франции от Sports.ru для iOS - это вся информация о чемпионате Франции по футболу сегодня! 

Приложение Лига 1 включает: 

• Все свежие новости о всех 20 клубах чемпионата Франции из более чем 700 источников;
• Освещение всех игр и событий сезона; 
• Полная информация о трансферах; 
• Полная статистика всех матчей чемпионата в режиме реального времени, а также статистика игроков; 
• Текстовые онлайн трансляции всех матчей, календарь чемпионата Франции и турнирная таблица; 
• Интервью, репортажи и мнения экспертов; 
• Галереи с яркими и актуальными фото; 
• Блоги и материалы пользователей о Лиге 1; 
• Широкие возможности для общения с другими 
болельщиками команды. 

Приложение о чемпионате Франции освещает все команды турнира: 

ПСЖ, Лилль, Монако, Нант, Марсель, Реймс, Лион, Генгам, Сент-Этьен, Бастия, Ренн, Бордо, Ницца, Эвиан, Тулуза, Монпелье, Лорьян, Ланс, Метц, Кан.

Хоккейный клуб ЦСКА представляет вам своё официальное приложение для iPhone.

С помощью приложения вы сможете:
- получать уведомления о предстоящей игре любимой команды;
- читать самые свежие новости хоккейного клуба ЦСКА;
- просматривать информацию о предстоящих и прошедших играх клуба;
- узнать подробные сведения об игроках клуба и его тренерском штабе;
- просмотреть фото и видео отчеты с игр и тренировок клуба;
- просмотреть турнирную таблицу;
- иметь под рукой возможность купить билеты на игру!

